import React, { useState } from "react";
import Contents from "../pagecomps/Contents";
import Header from "../pagecomps/Header";
import axios from "axios";
import "./index.css";

const AllClients = () => {
  const [datas, setDatas] = useState();

  axios.get("http://localhost:3001/api/users/listclients").then((res) => {
    setDatas(res);
  });

  return (
    <>
      <Header />
      <div className="contents_container">
        <table className="allclients">
          <thead>
            <tr>
              <th>Name</th>
              <th>Email</th>
              <th>Mobile</th>
              <th>Client Type</th>
            </tr>
          </thead>
          <tbody>
            {Object.entries(datas).map((data) => {
              console.log(data);
            })}
          </tbody>
        </table>
      </div>
      ;
    </>
  );
};

export default AllClients;
